                {/* ----------- CONTACT ---------- */}

                {/* --------- MENU -------- */}
                <div id={styles.menu}>
                    <h4 className={FooterStyles.title}>MENU</h4>
                    <ul>
                        <li><Link smooth to="../App/App#about-me">About</Link></li>
                        <li><Link smooth to="../App/App#latest-projects">Projects</Link></li>
                        <li> className={FooterStyles.item}><Link smooth to="../App/App#interests">Skills / Interests</Link></li>
                        <li><Link smooth to="../App/App#contact">Contact</Link></li>
                    </ul>
                </div>

                {/* --------- Right Side -------- */}

            {/* --------- Footer Bottom -------- */}

        </footer>
    )
}

export default footer;
